    NewSpendComponent.prototype.sortByAphabet = function (dataBySort) {
        dataBySort.sort(function (a, b) {
            var nameA = a.name.toLowerCase();
            var nameB = b.name.toLowerCase();
            if (nameA < nameB) {
                return -1;
            }
            if (nameA > nameB) {
                return 1;
            }
        });
        return dataBySort;
    };
    NewSpendComponent.prototype.sortByNumber = function (dataBySort) {
        dataBySort.sort(function (a, b) {
            return b.id - a.id;
        });
        return dataBySort;
    };
